import React from "react";
const taskList = ({ tasks, deleteTaks }) => {
  return (
    <ul>
      {tasks.map((task) => (
        <li key={task.id}>
          {task.text}
          <button onClick={() => deleteTaks(task.id)}>Delete</button>
        </li>
      ))}
    </ul>
  );
};
export default taskList;
